def _init_logging_and_check_version(version, wafdir):
    """
    Initialise the logger and ensure that the version of the running
    script matches the version of the library.
    """
    Logs.init_log()
    if Context.WAFVERSION != version:
        Logs.error(
            'Waf script %r and library %r do not match (directory %r)' %
            (version, Context.WAFVERSION, wafdir)
        )
        sys.exit(1)


def _handle_version_argument(current_directory):
    """
    If the user asked for ``--version`` we only need to parse the
    ``options`` context and exit.
    """
    if '--version' in sys.argv:
        Context.run_dir = current_directory
        ctx = Context.create_context('options')
        ctx.curdir = current_directory
        ctx.parse_args()
        sys.exit(0)


def _find_run_dir(start_dir):
    """
    Walk up the directory tree looking for a lock file or a ``wscript``.
    Returns the directory that should be used as the run directory.
    Handles the ``-h/--help`` case as well.
    """
    # ------------------------------------------------------------------
    # 1) Look for a lock file – this gives us the exact run/top/out dirs.
    # ------------------------------------------------------------------
    cur = start_dir
    while cur:
        lst = os.listdir(cur)

        if Options.lockfile in lst:
            env = ConfigSet.ConfigSet()
            try:
                env.load(os.path.join(cur, Options.lockfile))
                ino = os.stat(cur)[stat.ST_INO]
            except Exception:
                pass
            else:
                load = False
                for x in [env.run_dir, env.top_dir, env.out_dir]:
                    if Utils.is_win32:
                        if cur == x:
                            load = True
                            break
                    else:
                        try:
                            ino2 = os.stat(x)[stat.ST_INO]
                        except OSError:
                            pass
                        else:
                            if ino == ino2:
                                load = True
                                break
                if not load:
                    Logs.warn('invalid lock file in %s' % cur)

                if load:
                    Context.run_dir = env.run_dir
                    Context.top_dir = env.top_dir
                    Context.out_dir = env.out_dir
                    break

        # ------------------------------------------------------------------
        # 2) No lock file – look for a wscript file.
        # ------------------------------------------------------------------
        if not Context.run_dir and Context.WSCRIPT_FILE in lst:
            Context.run_dir = cur

        # ------------------------------------------------------------------
        # 3) Stop climbing if the user asked for it.
        # ------------------------------------------------------------------
        next_dir = os.path.dirname(cur)
        if next_dir == cur:
            break
        cur = next_dir

        # ``NOCLIMB`` environment variable may stop the search early.
        if os.environ.get('NOCLIMB') and any(k in sys.argv for k in no_climb_commands):
            break

    # ----------------------------------------------------------------------
    # If we still have not found a run directory, handle the help case or
    # abort with a clear error message.
    # ----------------------------------------------------------------------
    if not Context.run_dir:
        if '-h' in sys.argv or '--help' in sys.argv:
            Logs.warn('No wscript file found: the help message may be incomplete')
            Context.run_dir = start_dir
            ctx = Context.create_context('options')
            ctx.curdir = start_dir
            ctx.parse_args()
            sys.exit(0)

        Logs.error('Waf: Run from a directory containing a file named %r' %
                   Context.WSCRIPT_FILE)
        sys.exit(1)

    return Context.run_dir


def _change_to_run_dir(run_dir):
    """
    Change the current working directory to the run directory.
    Abort with a clear message if the directory cannot be accessed.
    """
    try:
        os.chdir(run_dir)
    except OSError:
        Logs.error('Waf: The folder %r is unreadable' % run_dir)
        sys.exit(1)


def _load_main_module(run_dir):
    """
    Load the project's ``wscript`` file as the main module.
    Errors are reported and the process exits with the appropriate code.
    """
    try:
        set_main_module(run_dir + os.sep + Context.WSCRIPT_FILE)
    except Errors.WafError as e:
        Logs.pprint('RED', e.verbose_msg)
        Logs.error(str(e))
        sys.exit(1)
    except Exception as e:  # pragma: no cover – defensive programming
        Logs.error('Waf: The wscript in %r is unreadable' % run_dir, e)
        traceback.print_exc(file=sys.stdout)
        sys.exit(2)


def _run_commands():
    """
    Execute the command chain (init → user commands → shutdown) and
    handle any errors that may arise.
    """
    try:
        run_commands()
    except Errors.WafError as e:
        if Logs.verbose > 1:
            Logs.pprint('RED', e.verbose_msg)
        Logs.error(e.msg)
        sys.exit(1)
    except SystemExit:
        raise
    except Exception:  # pragma: no cover – defensive programming
        traceback.print_exc(file=sys.stdout)
        sys.exit(2)
    except KeyboardInterrupt:  # pragma: no cover – user abort
        Logs.pprint('RED', 'Interrupted')
