def waf_entry_point(current_directory, version, wafdir):
    """
    Entry point used by the generated ``waf`` script.
    It performs the following steps:

    1. Initialise logging and verify the version.
    2. Handle the ``--version`` command‑line flag.
    3. Determine the run directory (handling lock files, ``wscript`` and help).
    4. Change to the run directory.
    5. Load the project's main module.
    6. Execute the requested commands.
    """
    # 1) Logging + version check
    _init_logging_and_check_version(version, wafdir)

    # 2) ``--version`` shortcut
    _handle_version_argument(current_directory)

    # 3) Find the directory that contains the project's ``wscript``
    Context.waf_dir = wafdir
    Context.launch_dir = current_directory
    run_dir = _find_run_dir(current_directory)

    # 4) Switch to that directory
    _change_to_run_dir(run_dir)

    # 5) Load the project's ``wscript`` as a module
    _load_main_module(run_dir)

    # 6) Run the command chain (init, user commands, shutdown)
    _run_commands()


