        return node.abspath()

    def add_tar_file(self, x, tar):
        p = self.get_tar_path(x)
        tinfo = tar.gettarinfo(name=p,
                               arcname=self.get_tar_prefix() + '/' + x.path_from(self.base_path))
        tinfo.uid = 0
        tinfo.gid = 0
        tinfo.uname = 'root'
        tinfo.gname = 'root'
        fu = None
        try:
            fu = open(p, 'rb')
            tar.addfile(tinfo, fileobj=fu)
        finally:
            if fu:
